            <TextField id="standard-basic" label="Address" />
            <TextField id="standard-basic" label="Emaill" />
          </form>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Cancel
          </Button>
          <Button onClick={handleAddContact} color="primary">
            Add Contact
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
